import {
  Table, TableBody, TableCell, TableContainer,
  TableHead, TableRow, Paper, Chip, Box, IconButton
} from '@mui/material';
import {DndContext, closestCenter} from '@dnd-kit/core';
import {
  arrayMove,
  SortableContext,
  useSortable,
  verticalListSortingStrategy,
} from '@dnd-kit/sortable';
import {CSS} from '@dnd-kit/utilities';
import DragHandleIcon from '@mui/icons-material/DragHandle';
import {useState} from 'react';
import {Rule} from '../types/rule';
import {reorderRule} from '../api/rules';

type Props = {
  rules: Rule[];
  onReorder: () => void;
};

function SortableRow({rule}: {rule: Rule}) {
  const {
    attributes,
    listeners,
    setNodeRef,
    transform,
    transition,
  } = useSortable({id: rule._id});

  const style = {
    transform: CSS.Transform.toString(transform),
    transition,
  };

  return (
    <TableRow ref={setNodeRef} style={style}>
      <TableCell>
        <IconButton {...attributes} {...listeners}>
          <DragHandleIcon />
        </IconButton>
        {rule.ruleIndex}
      </TableCell>
      <TableCell>
        <Chip label={rule.action} color={rule.action === 'Block' ? 'error' : 'success'} />
      </TableCell>
      <TableCell>{rule.name}</TableCell>
      <TableCell>
        <Box display="flex" flexWrap="wrap" gap={1}>
          {rule.source.map((s) => (
            <Chip key={s.email} label={s.name} />
          ))}
        </Box>
      </TableCell>
      <TableCell>
        <Box display="flex" flexWrap="wrap" gap={1}>
          {rule.destination.map((d) => (
            <Chip key={d.address} label={d.name} />
          ))}
        </Box>
      </TableCell>
    </TableRow>
  );
}

export const RuleTable = ({rules, onReorder}: Props) => {
  const [items, setItems] = useState(rules.map((r) => r._id));

  const handleDragEnd = async (event: any) => {
    const {active, over} = event;
    if (active.id === over.id) return;

    const oldIndex = items.indexOf(active.id);
    const newIndex = items.indexOf(over.id);
    const newItems = arrayMove(items, oldIndex, newIndex);
    setItems(newItems);

    const movedId = active.id;
    const beforeId = newItems[newIndex - 1] || null;
    const afterId = newItems[newIndex + 1] || null;

    await reorderRule(movedId, beforeId, afterId);
    onReorder(); // refresh data
  };

  return (
    <TableContainer component={Paper}>
      <DndContext collisionDetection={closestCenter} onDragEnd={handleDragEnd}>
        <SortableContext items={items} strategy={verticalListSortingStrategy}>
          <Table>
            <TableHead sx={{ backgroundColor: '#1f2a44' }}>
              <TableRow>
                <TableCell sx={{ color: '#fff' }}>#</TableCell>
                <TableCell sx={{ color: '#fff' }}>Action</TableCell>
                <TableCell sx={{ color: '#fff' }}>Name</TableCell>
                <TableCell sx={{ color: '#fff' }}>Source</TableCell>
                <TableCell sx={{ color: '#fff' }}>Destination</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {rules.map((rule) => (
                <SortableRow key={rule._id} rule={rule} />
              ))}
            </TableBody>
          </Table>
        </SortableContext>
      </DndContext>
    </TableContainer>
  );
};
